import pandas as pd
import numpy as np
import matplotlib.pyplot as plt

def price_change(filepath, exchange_rates, wave_products):
    # Read the data
    data = pd.read_excel(filepath)
    
    # Filter out products with incomplete data
    complete_data = data.dropna()
    complete_data.loc[:, 'HS 6'] = complete_data['HS 6'].astype(str)
    
    # Normalize prices based on 2017 exchange rates
    for year in range(2015, 2022):
        complete_data.loc[:, f'Price_{year}'] = complete_data[f'Price_{year}'] / exchange_rates[year]
    
    lower_quantile = 0.05  # Exclude the lowest 5%
    upper_quantile = 0.95  # Exclude the highest 5%
    for year in range(2015, 2022):
        bounds = complete_data[f'Price_{year}'].quantile([lower_quantile, upper_quantile])
        complete_data = complete_data[(complete_data[f'Price_{year}'] > bounds.loc[lower_quantile]) &
                                      (complete_data[f'Price_{year}'] < bounds.loc[upper_quantile])]

    # Assuming wave_products is a dictionary listing the HS 6 codes for each wave
    all_wave_products = set()
    for products in wave_products.values():
        all_wave_products.update(products)

    # Identify untreated products
    untreated_products = set(complete_data['HS 6']) - all_wave_products

    # Calculate average prices for each wave including untreated
    average_prices = {}
    waves = list(wave_products.keys()) + ['Untreated']
    for wave in waves:
        if wave == 'Untreated':
            products = untreated_products
        else:
            products = wave_products[wave]

        wave_data = complete_data[complete_data['HS 6'].isin(products)]
        average_prices[wave] = wave_data[[f'Price_{year}' for year in range(2015, 2022)]].mean()
        
    # Calculate proportional changes based on 2017
    proportional_changes = {}
    for wave in waves:
        base_price = average_prices[wave]['Price_2017']
        proportional_changes[wave] = (average_prices[wave] / base_price) - 1

    # Plotting
    plt.figure(figsize=(12, 8), dpi=600)
    for wave in waves:
        plt.plot(range(2015, 2022), proportional_changes[wave], marker='o', label=wave)
    plt.axhline(0, color='grey', linewidth=0.8)  # Add a line at zero
    plt.axvline(x=2017, color='red', linestyle='--', linewidth=1)
    plt.xlabel('Year')
    plt.ylabel('Proportional Change')
    plt.legend(loc='upper center', bbox_to_anchor=(0.5, -0.1), fancybox=True, shadow=True, ncol=len(waves))
    plt.grid(True)
    plt.show()

def value_change(filepath, exchange_rates, wave_products):
    import pandas as pd
    import matplotlib.pyplot as plt

    # Read the data
    data = pd.read_excel(filepath)
    
    # Filter out products with incomplete data
    complete_data = data.dropna()
    complete_data.loc[:, 'HS 6'] = complete_data['HS 6'].astype(str)
    
    # Normalize values based on 2017 exchange rates
    for year in range(2015, 2022):
        complete_data.loc[:, f'Value_{year}'] = complete_data[f'Value_{year}'] / exchange_rates[year]
    

    # Assuming wave_products is a dictionary listing the HS 6 codes for each wave
    all_wave_products = set()
    for products in wave_products.values():
        all_wave_products.update(products)

    # Identify untreated products
    untreated_products = set(complete_data['HS 6']) - all_wave_products

    # Calculate total values for each wave including untreated
    total_values = {}
    waves = list(wave_products.keys()) + ['Untreated']
    for wave in waves:
        if wave == 'Untreated':
            products = untreated_products
        else:
            products = wave_products[wave]

        wave_data = complete_data[complete_data['HS 6'].isin(products)]
        total_values[wave] = wave_data[[f'Value_{year}' for year in range(2015, 2022)]].sum()
        
    # Calculate proportional changes based on 2017
    proportional_changes = {}
    for wave in waves:
        base_value = total_values[wave]['Value_2017']
        proportional_changes[wave] = (total_values[wave] / base_value) - 1

    # Plotting
    plt.figure(figsize=(12, 8), dpi=600)
    for wave in waves:
        plt.plot(range(2015, 2022), proportional_changes[wave], marker='o', label=wave)
    plt.axhline(0, color='grey', linewidth=0.8)  # Add a line at zero
    plt.axvline(x=2017, color='red', linestyle='--', linewidth=1)
    plt.xlabel('Year')
    plt.ylabel('Proportional Change in Total Values')
    plt.legend(loc='upper center', bbox_to_anchor=(0.5, -0.1), fancybox=True, shadow=True, ncol=len(waves))
    plt.grid(True)
    plt.show()
    
